ect\" statements (follow the\\\\nvalue of a variable, inspect element/population)','monitors_and_inspectors'),(22,'User Control\\nArchitecture','runtime controlled by the user through the\\\\n\"user_only\"/\"user_first\"/\"user_last\" architectures','user_control_architecture'),(23,'Finite State\\nMachine','finite state machine behavior model\\\\n(\"state\"/\"transition\" statements)','finite_state_machine'),(24,'Task Based','\"weighted_tasks\"/\"sorted_tasks\"/\"probabilistic_tasks\" architectures\\\\n\"ask\" statement','task_based'),(25,'BDI','belief-desire-intention architecture,\\\\n\"predicate\"/\"rule\"/\"plan\" statements','bdi'),(26,'FIPA / ACL','communication between agents','fipa_acl'),(27,'Runtime and\\nSchedulers','control the runtime using scheduler','runtime_and_schedulers'),(28,'Optimizing tips','tips about scheduler, grid, operators and displays','optimizing_tips'),(29,'Run Simulations\\nas Agents','run multiple simulations in the same experiment','run_simulations_as_agents'),(30,'Control Randomness','control the seed, a word about RNG','control_randomness'),(31,'Batch\\nExperiments','run several experiments using batch experiments','batch_experiments'),(32,'Run several\\nmodels (using\\nGAMAnalyzer)','bla bla bla','run_several_models_using_gamanalyzer'),(33,'Exploration\\nMethods','explore parameter space with methods :\\\\n\"hill climbing\", \"tabu search\", \"genetic\"...','exploration_methods'),(34,'Multi-level','micro/macro agents : \"members\"/\"host\" built-in,\\\\n\"capture\"/\"release\"/\"migrate\" statements','multi_level'),(35,'Call R','data mining and statistics with R','call_r'),(36,'Use Database','SQLSKILL and MDXSKILL for queries','use_database'),(37,'Export files','save files with \"save\"/\"output_file\" statements,\\\\nor with \"autosave\" facet.','export_files'),(38,'Use OSM Datas','load openstreetmap files in gama,\\\\na word about qgis software','use_osm_datas'),(39,'Load complex\\ndatas','load Text, CVS, Shapefile, OSM, Grid,\\\\nimages, SVG, 3DS, OBJ...','load_complex_datas');
